  const [loading,setLoading]=useState(true);

  const fetchTours = async()=>
  { 
    setLoading(true);
    const response = await fetch(`https://www.course-api.com/react-tours-project`)
    const tours = await fetch.json();
  }
  if(loading)return(
    <main><Loading/> </main>
)
  return (
    <>
    <main><Tours/></main>

    </>
  );
}

export default App;
